import React from "react";
import MovieCard from "./cardMovie/MovieCard";
import "../index.css";

function MovieList() {
  const movies = [1, 2, 3];
  return (
    <div className="movielist">
      {movies.map((movie, i) => (
        <MovieCard
          title="Man of Steel"
          posterUrl="https://images-na.ssl-images-amazon.com/images/I/812LjT-we7L._SL1024_.jpg"
          description="An alien child is 
          evacuated from his dying world 
          and sent to Earth to live among 
          humans. His peace is threatened, 
          when other survivors of his home 
          planet invade Earth."
          key="i"
        />
      ))}
    </div>
  );
}

export default MovieList;
